PRAGMA defer_foreign_keys=TRUE;
CREATE TABLE d1_migrations(
		id         INTEGER PRIMARY KEY AUTOINCREMENT,
		name       TEXT UNIQUE,
		applied_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP NOT NULL
);
CREATE TABLE products (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  sku TEXT UNIQUE NOT NULL,
  name TEXT NOT NULL,
  category TEXT NOT NULL,
  description TEXT,
  purchase_price REAL NOT NULL,
  selling_price REAL NOT NULL,
  current_stock INTEGER NOT NULL DEFAULT 0,
  min_stock_alert INTEGER DEFAULT 10,
  supplier TEXT,
  is_active BOOLEAN DEFAULT 1,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP
, category_medium TEXT, category_small TEXT, image_url TEXT, brand TEXT, tags TEXT, status TEXT DEFAULT 'sale', specifications TEXT, tenant_id INTEGER REFERENCES tenants(id), parent_id INTEGER, product_type TEXT DEFAULT 'simple', has_options BOOLEAN DEFAULT 0);
CREATE TABLE customers (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  name TEXT NOT NULL,
  phone TEXT NOT NULL,
  email TEXT,
  address TEXT,
  birthday DATE,
  grade TEXT DEFAULT '일반',
  notes TEXT,
  total_purchase_amount REAL DEFAULT 0,
  purchase_count INTEGER DEFAULT 0,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP
, company TEXT, department TEXT, position TEXT, zip_code TEXT, address_detail TEXT, tenant_id INTEGER REFERENCES tenants(id), purchase_path TEXT);
CREATE TABLE sales (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  customer_id INTEGER,
  total_amount REAL NOT NULL,
  discount_amount REAL DEFAULT 0,
  final_amount REAL NOT NULL,
  payment_method TEXT NOT NULL,
  notes TEXT,
  status TEXT DEFAULT 'completed',
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP, shipping_address TEXT, tracking_number TEXT, courier TEXT, tenant_id INTEGER REFERENCES tenants(id), warehouse_id INTEGER REFERENCES warehouses(id), created_by INTEGER REFERENCES users(id),
  FOREIGN KEY (customer_id) REFERENCES customers(id)
);
CREATE TABLE sale_items (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  sale_id INTEGER NOT NULL,
  product_id INTEGER NOT NULL,
  quantity INTEGER NOT NULL,
  unit_price REAL NOT NULL,
  subtotal REAL NOT NULL,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (sale_id) REFERENCES sales(id) ON DELETE CASCADE,
  FOREIGN KEY (product_id) REFERENCES products(id)
);
CREATE TABLE stock_movements (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  product_id INTEGER NOT NULL,
  movement_type TEXT NOT NULL,
  quantity INTEGER NOT NULL,
  reason TEXT,
  reference_id INTEGER,
  notes TEXT,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP, tenant_id INTEGER REFERENCES tenants(id), warehouse_id INTEGER REFERENCES warehouses(id), to_warehouse_id INTEGER REFERENCES warehouses(id), created_by INTEGER REFERENCES users(id),
  FOREIGN KEY (product_id) REFERENCES products(id)
);
CREATE TABLE claims (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  sale_id INTEGER NOT NULL,
  type TEXT NOT NULL CHECK (type IN ('return', 'exchange')),
  status TEXT NOT NULL DEFAULT 'requested', 
  reason TEXT,
  admin_notes TEXT,
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP, tenant_id INTEGER REFERENCES tenants(id), warehouse_id INTEGER REFERENCES warehouses(id), created_by INTEGER REFERENCES users(id),
  FOREIGN KEY (sale_id) REFERENCES sales(id)
);
CREATE TABLE claim_items (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  claim_id INTEGER NOT NULL,
  product_id INTEGER NOT NULL,
  quantity INTEGER NOT NULL,
  condition TEXT, 
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (claim_id) REFERENCES claims(id),
  FOREIGN KEY (product_id) REFERENCES products(id)
);
CREATE TABLE users (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  name TEXT NOT NULL,
  email TEXT NOT NULL UNIQUE,
  role TEXT DEFAULT 'staff', 
  avatar_url TEXT,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP
, tenant_id INTEGER REFERENCES tenants(id), password_hash TEXT);
CREATE TABLE stock_lots (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    product_id INTEGER NOT NULL,
    lot_number TEXT,
    quantity INTEGER NOT NULL, 
    remaining_quantity INTEGER NOT NULL, 
    expiry_date TEXT,
    created_at TEXT DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (product_id) REFERENCES products(id)
);
CREATE TABLE outbound_orders (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    order_number TEXT NOT NULL UNIQUE,
    destination_name TEXT,
    destination_address TEXT,
    destination_phone TEXT,
    status TEXT DEFAULT 'PENDING', 
    notes TEXT,
    created_at TEXT DEFAULT CURRENT_TIMESTAMP,
    updated_at TEXT DEFAULT CURRENT_TIMESTAMP
, tenant_id INTEGER REFERENCES tenants(id), created_by INTEGER REFERENCES users(id), purchase_path TEXT, warehouse_id INTEGER REFERENCES warehouses(id));
CREATE TABLE outbound_order_mappings (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    outbound_order_id INTEGER NOT NULL,
    sale_id INTEGER NOT NULL,
    FOREIGN KEY (outbound_order_id) REFERENCES outbound_orders(id),
    FOREIGN KEY (sale_id) REFERENCES sales(id)
);
CREATE TABLE outbound_items (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    outbound_order_id INTEGER NOT NULL,
    product_id INTEGER NOT NULL,
    quantity_ordered INTEGER NOT NULL,
    quantity_picked INTEGER DEFAULT 0,
    quantity_packed INTEGER DEFAULT 0,
    status TEXT DEFAULT 'PENDING', 
    FOREIGN KEY (outbound_order_id) REFERENCES outbound_orders(id),
    FOREIGN KEY (product_id) REFERENCES products(id)
);
CREATE TABLE outbound_packages (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    outbound_order_id INTEGER NOT NULL,
    tracking_number TEXT,
    courier TEXT,
    box_type TEXT,
    box_count INTEGER DEFAULT 1,
    weight REAL,
    created_at TEXT DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (outbound_order_id) REFERENCES outbound_orders(id)
);
CREATE TABLE tenants (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  name TEXT NOT NULL,
  plan_type TEXT DEFAULT 'FREE', 
  status TEXT DEFAULT 'ACTIVE', 
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP
, logo_url TEXT);
CREATE TABLE warehouses (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  tenant_id INTEGER REFERENCES tenants(id),
  name TEXT NOT NULL,
  location TEXT,
  description TEXT,
  is_active INTEGER DEFAULT 1,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP
);
CREATE TABLE product_warehouse_stocks (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  tenant_id INTEGER REFERENCES tenants(id),
  product_id INTEGER REFERENCES products(id),
  warehouse_id INTEGER REFERENCES warehouses(id),
  quantity INTEGER DEFAULT 0,
  location_code TEXT, 
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  UNIQUE(product_id, warehouse_id)
);
CREATE TABLE plan_change_requests (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    tenant_id INTEGER NOT NULL,
    request_user_id INTEGER, -- 요청한 사용자 ID
    current_plan TEXT NOT NULL,
    requested_plan TEXT NOT NULL,
    status TEXT DEFAULT 'PENDING', -- PENDING, APPROVED, REJECTED
    requested_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    processed_at DATETIME,
    processed_by INTEGER, -- 처리한 슈퍼 관리자 ID
    FOREIGN KEY (tenant_id) REFERENCES tenants(id),
    FOREIGN KEY (request_user_id) REFERENCES users(id)
);
CREATE TABLE suppliers (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  tenant_id INTEGER NOT NULL,
  name TEXT NOT NULL,
  contact_person TEXT,
  phone TEXT,
  email TEXT,
  address TEXT,
  business_number TEXT, 
  notes TEXT,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (tenant_id) REFERENCES tenants(id)
);
CREATE TABLE purchase_orders (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  tenant_id INTEGER NOT NULL,
  supplier_id INTEGER NOT NULL,
  code TEXT, 
  status TEXT DEFAULT 'DRAFT', 
  total_amount REAL DEFAULT 0,
  expected_at DATETIME, 
  received_at DATETIME, 
  created_by INTEGER,
  notes TEXT,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (tenant_id) REFERENCES tenants(id),
  FOREIGN KEY (supplier_id) REFERENCES suppliers(id),
  FOREIGN KEY (created_by) REFERENCES users(id)
);
CREATE TABLE purchase_items (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  purchase_order_id INTEGER NOT NULL,
  product_id INTEGER NOT NULL,
  quantity INTEGER NOT NULL, 
  unit_price REAL NOT NULL, 
  received_quantity INTEGER DEFAULT 0, 
  FOREIGN KEY (purchase_order_id) REFERENCES purchase_orders(id) ON DELETE CASCADE,
  FOREIGN KEY (product_id) REFERENCES products(id)
);
CREATE TABLE settings (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    tenant_id INTEGER NOT NULL,
    setting_key TEXT NOT NULL,
    setting_value TEXT,
    description TEXT,
    is_encrypted INTEGER DEFAULT 0, -- 1이면 암호화된 값
    created_at TEXT DEFAULT CURRENT_TIMESTAMP,
    updated_at TEXT DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (tenant_id) REFERENCES tenants(id) ON DELETE CASCADE,
    UNIQUE(tenant_id, setting_key)
);
CREATE TABLE product_option_groups (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  tenant_id INTEGER NOT NULL,
  name TEXT NOT NULL,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP
);
CREATE TABLE product_option_values (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  tenant_id INTEGER NOT NULL,
  group_id INTEGER NOT NULL,
  value TEXT NOT NULL,
  additional_price REAL DEFAULT 0,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (group_id) REFERENCES product_option_groups(id) ON DELETE CASCADE
);
CREATE TABLE product_variant_options (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  tenant_id INTEGER NOT NULL,
  product_id INTEGER NOT NULL, -- Variant Product ID
  option_group_id INTEGER NOT NULL,
  option_value_id INTEGER NOT NULL,
  FOREIGN KEY (product_id) REFERENCES products(id) ON DELETE CASCADE,
  FOREIGN KEY (option_group_id) REFERENCES product_option_groups(id),
  FOREIGN KEY (option_value_id) REFERENCES product_option_values(id)
);
CREATE TABLE product_bundles (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  tenant_id INTEGER NOT NULL,
  master_product_id INTEGER NOT NULL, -- 세트 상품 (Bundle Product ID)
  component_product_id INTEGER NOT NULL, -- 구성 상품 (Component Product ID)
  quantity INTEGER NOT NULL DEFAULT 1, -- 구성 수량
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (master_product_id) REFERENCES products(id) ON DELETE CASCADE,
  FOREIGN KEY (component_product_id) REFERENCES products(id)
);
CREATE TABLE product_grade_prices (id INTEGER PRIMARY KEY AUTOINCREMENT, tenant_id TEXT NOT NULL, product_id INTEGER NOT NULL, grade TEXT NOT NULL, price REAL NOT NULL, created_at DATETIME DEFAULT CURRENT_TIMESTAMP, updated_at DATETIME DEFAULT CURRENT_TIMESTAMP, FOREIGN KEY (product_id) REFERENCES products(id), UNIQUE(tenant_id, product_id, grade));
CREATE TABLE product_customer_prices (id INTEGER PRIMARY KEY AUTOINCREMENT, tenant_id TEXT NOT NULL, customer_id INTEGER NOT NULL, product_id INTEGER NOT NULL, price REAL NOT NULL, created_at DATETIME DEFAULT CURRENT_TIMESTAMP, updated_at DATETIME DEFAULT CURRENT_TIMESTAMP, FOREIGN KEY (customer_id) REFERENCES customers(id), FOREIGN KEY (product_id) REFERENCES products(id), UNIQUE(tenant_id, customer_id, product_id));
DELETE FROM sqlite_sequence;
CREATE INDEX idx_products_sku ON products(sku);
CREATE INDEX idx_products_category ON products(category);
CREATE INDEX idx_products_is_active ON products(is_active);
CREATE INDEX idx_customers_phone ON customers(phone);
CREATE INDEX idx_customers_name ON customers(name);
CREATE INDEX idx_sales_customer_id ON sales(customer_id);
CREATE INDEX idx_sales_created_at ON sales(created_at);
CREATE INDEX idx_sales_status ON sales(status);
CREATE INDEX idx_sale_items_sale_id ON sale_items(sale_id);
CREATE INDEX idx_sale_items_product_id ON sale_items(product_id);
CREATE INDEX idx_stock_movements_product_id ON stock_movements(product_id);
CREATE INDEX idx_stock_movements_created_at ON stock_movements(created_at);
CREATE INDEX idx_users_tenant_id ON users(tenant_id);
CREATE INDEX idx_products_tenant_id ON products(tenant_id);
CREATE INDEX idx_customers_tenant_id ON customers(tenant_id);
CREATE INDEX idx_sales_tenant_id ON sales(tenant_id);
CREATE INDEX idx_stock_movements_tenant_id ON stock_movements(tenant_id);
CREATE INDEX idx_outbound_orders_tenant_id ON outbound_orders(tenant_id);
CREATE INDEX idx_claims_tenant_id ON claims(tenant_id);
CREATE INDEX idx_product_warehouse_stocks_product_id ON product_warehouse_stocks(product_id);
CREATE INDEX idx_product_warehouse_stocks_warehouse_id ON product_warehouse_stocks(warehouse_id);
CREATE INDEX idx_stock_movements_warehouse_id ON stock_movements(warehouse_id);
CREATE INDEX idx_sales_warehouse_id ON sales(warehouse_id);
CREATE INDEX idx_plan_requests_tenant ON plan_change_requests(tenant_id);
CREATE INDEX idx_plan_requests_status ON plan_change_requests(status);
CREATE INDEX idx_suppliers_tenant ON suppliers(tenant_id);
CREATE INDEX idx_purchase_orders_tenant ON purchase_orders(tenant_id);
CREATE INDEX idx_purchase_orders_supplier ON purchase_orders(supplier_id);
CREATE INDEX idx_purchase_orders_status ON purchase_orders(status);
CREATE INDEX idx_purchase_items_order ON purchase_items(purchase_order_id);
CREATE INDEX idx_settings_tenant ON settings(tenant_id);
CREATE INDEX idx_settings_key ON settings(tenant_id, setting_key);
CREATE INDEX idx_products_parent_id ON products(parent_id);
CREATE INDEX idx_products_type ON products(product_type);
CREATE INDEX idx_product_option_groups_tenant ON product_option_groups(tenant_id);
CREATE INDEX idx_product_option_values_group ON product_option_values(group_id);
CREATE INDEX idx_product_variant_options_product ON product_variant_options(product_id);
CREATE INDEX idx_product_bundles_master ON product_bundles(master_product_id);
CREATE INDEX idx_product_bundles_component ON product_bundles(component_product_id);
